import React, { useContext } from 'react';
import { Book, Tv, Clock, Calendar } from 'lucide-react';
import data from '../Context/ContextApi';
import profileStyles from '../styles/pages/Profile.module.css';

const Profile = () => {
  const { userData } = useContext(data);

  const stats = [
    {
      title: "Anime Watched",
      value: userData.animes?.length || 0,
      icon: Tv,
      color: "text-blue-500"
    },
    {
      title: "Manga Read",
      value: userData.mangas?.length || 0,
      icon: Book,
      color: "text-purple-500"
    },
    {
      title: "Days Watched",
      value: userData.daysWatched || 0,
      icon: Clock,
      color: "text-green-500"
    },
    {
      title: "Member Since",
      value: new Date(userData.createdAt).getFullYear(),
      icon: Calendar,
      color: "text-orange-500"
    }
  ];

  return (
    <div className="p-8 max-w-7xl mx-auto">
      {/* Profile Header */}
      <div className="mb-8">
        <div className="flex items-center gap-6">
          <div className="h-24 w-24 rounded-full bg-gradient-to-r from-blue-500 to-purple-500 flex items-center justify-center">
            <span className="text-3xl font-bold text-white">
              {userData.username?.charAt(0).toUpperCase()}
            </span>
          </div>
          <div>
            <h1 className="text-3xl font-bold mb-2">{userData.username}</h1>
            <p className="text-gray-500">Member since {new Date(userData.createdAt).toLocaleDateString()}</p>
          </div>
        </div>
      </div>

      {/* Stats Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4 mb-8">
        {stats.map((stat, index) => (
          <Card key={index}>
            <CardHeader className="flex flex-row items-center justify-between space-y-0 pb-2">
              <CardTitle className="text-sm font-medium">
                {stat.title}
              </CardTitle>
              <stat.icon className={`h-4 w-4 ${stat.color}`} />
            </CardHeader>
            <CardContent>
              <div className="text-2xl font-bold">{stat.value}</div>
            </CardContent>
          </Card>
        ))}
      </div>

      {/* Recent Activity */}
      <Card className="mb-8">
        <CardHeader>
          <CardTitle>Recent Activity</CardTitle>
        </CardHeader>
        <CardContent>
          <div className="space-y-4">
            {userData.recentActivity?.slice(0, 5).map((activity, index) => (
              <div key={index} className="flex items-center gap-4 p-2 rounded-lg hover:bg-gray-100 dark:hover:bg-gray-800">
                <div className="w-12 h-12 rounded bg-gray-200 dark:bg-gray-700" />
                <div>
                  <h3 className="font-medium">{activity.title}</h3>
                  <p className="text-sm text-gray-500">{activity.description}</p>
                </div>
              </div>
            )) || (
              <p className="text-gray-500 text-center py-4">No recent activity</p>
            )}
          </div>
        </CardContent>
      </Card>

      {/* User Preferences */}
      <Card>
        <CardHeader>
          <CardTitle>Preferences</CardTitle>
        </CardHeader>
        <CardContent>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <div>
              <h3 className="font-medium mb-2">Favorite Genres</h3>
              <div className="flex flex-wrap gap-2">
                {userData.favoriteGenres?.map((genre, index) => (
                  <span 
                    key={index}
                    className="px-3 py-1 rounded-full text-sm bg-blue-100 text-blue-700 dark:bg-blue-900 dark:text-blue-100"
                  >
                    {genre}
                  </span>
                )) || (
                  <span className="text-gray-500">No favorite genres set</span>
                )}
              </div>
            </div>
            <div>
              <h3 className="font-medium mb-2">Watching Preferences</h3>
              <div className="space-y-2">
                <p className="text-sm text-gray-600 dark:text-gray-300">
                  Language: {userData.preferences?.language || "Not set"}
                </p>
                <p className="text-sm text-gray-600 dark:text-gray-300">
                  Release Type: {userData.preferences?.releaseType || "Not set"}
                </p>
              </div>
            </div>
          </div>
        </CardContent>
      </Card>
    </div>
  );
};

export default Profile;
